css:
.editor-colors {
  background-color: #2d2d2d;
  color: #a09f93;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #515151;
}
.editor .gutter {
  background-color: #393939;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d27b53;
}
.editor .cursor {
  border-color: #f2f0ec;
}
.editor .selection .region {
  background-color: #515151;
  color: #2d2d2d;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #515151;
}
.bracket-matcher {
  background-color: #d3d0c8;
  opacity: 0.7;
}
.comment {
  color: #515151;
  font-style: italic;
}
.entity {
  color: #ffcc66;
}
.keyword {
  color: #d27b53;
}
.storage.type {
  color: #99cc99;
}
.constant {
  color: #ffcc66;
}
.constant.numeric,
.constant.boolean {
  color: #6666cc CC;
}
.variable {
  color: #6699cc;
}
.delimiter,
.brace {
  color: #f2777a;
}
.delimiter.period {
  color: #99cc99;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #f2777a;
}
.invalid.illegal {
  color: #f2777a;
}
.class.support {
  color: #ffcc66;
}
.string {
  color: #99cc99;
}
.string .constant.character.escape {
  color: #f2777a;
}
.string.regexp {
  color: #6666cc CC;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #f2777a;
}
.constant {
  color: #F2777A;
}
.constant.numeric {
  color: #F99157;
}
.constant.symbol,
.constant.punctuation {
  color: #99CC99;
}
.constant.boolean {
  color: #f99157;
}
.keyword.control {
  color: #cc99cc;
}
.editor-colors {
  color: #d3d0c8;
}
.punctuation {
  color: #d3d0c8;
}
.punctuation.separator,
.punctuation.definition {
  color: #99cc99;
}
.punctuation.comment {
  color: #515151;
}
.variable.block {
  color: #f2777a;
}
